def find_original_set(*args):
    if len(args) != 37:
        raise ValueError("This function requires exactly 37 arguments, each of which is a set of integers.")
    original_set = set()
    for arg in args:
        if not isinstance(arg, set):
            raise TypeError("Each argument should be a set.")
        original_set = original_set.union(arg)
    return original_set
